import React from "react";

const SearchTile = ({ data }) => {
  return (
    <div className="border p-4 rounded-lg m-4 w-64">
      <img
        className="h-48 w-full object-cover"
        src={data.image_url}
        alt={data.name}
      />
      <h2 className="mt-2 text-lg font-semibold">{data.name}</h2>
      <p className="mt-1 text-gray-500">Token ID: {data.token_id}</p>
      <p className="mt-1 text-gray-500">
        Contract Address: {data.asset_contract.address}
      </p>
    </div>
  );
};

export default SearchTile;
